import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default class BrowsePage extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <Container className="w-100 py-5">
        <Row>
          <Col>
            <p>Sort By: Release Date</p>
          </Col>
          <Col xs={2}>
            <p>Filters</p>
            <ul style={{inline}}>
              <li>Action</li>
            </ul>
          </Col>
        </Row>
      </Container>
    );
  }
}
